import React from "react"

class TechPresentation extends React.Component {

  render() {
    return (
      <div className="techContainer">
        <h3>Tech</h3>
        <p>
        480 coding hours &#9755; 50+ individual tasks &#9755;
        HTML5, CSS, SASS, Flexbox, Javascript, ES6, JSX, React, Node.js,
        Mongo DB, API:s &#9755;
        6 sprints with demos together with companies like Volumental,
        Bonnier, Comprend @ Technigo &#9755;
        Exploring Machine learning
        </p>
      </div>
    )
  }
}

export default TechPresentation
